    <style>
      @import "https://fonts.googleapis.com/css?family=Inconsolata";
        *{
            margin: 0; padding: 0;
        box-sizing: border-box;
        }
      html {
        min-height: 100%;
      }

      body {
        height: 100%;
        background-color: #000000;
        background-image: radial-gradient(#516582, #160b04),
          url("https://media.giphy.com/media/oEI9uBYSzLpBK/giphy.gif");
        background-repeat: no-repeat;
        background-size: cover;
        font-family: "Inconsolata", Helvetica, sans-serif;
        font-size: 1.5rem;
        color: rgba(255, 192, 128, 0.8);
        text-shadow: 0 0 1ex grey,
          0 0 2px rgba(255, 255, 255, 0.8);
          overflow: hidden;
          user-select: none;
          -webkit-user-select: none;
          -moz-user-select: none;
      }

      .noise {
        pointer-events: none;
        position: absolute;
        width: 100%;
        height: 100%;
        background-image: url("https://media.giphy.com/media/oEI9uBYSzLpBK/giphy.gif");
        background-repeat: no-repeat;
        background-size: cover;
        z-index: -1;
        opacity: 0.02;
      }

      .overlay {
        pointer-events: none;
        position: absolute;
        width: 100%;
        height: 100%;
        background: repeating-linear-gradient(
          180deg,
          rgba(0, 0, 0, 0) 0,
          rgba(0, 0, 0, 0.3) 50%,
          rgba(0, 0, 0, 0) 100%
        );
        background-size: auto 4px;
        z-index: 1;
      }

      .overlay::before {
        content: "";
        pointer-events: none;
        position: absolute;
        display: block;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        width: 100%;
        height: 100%;
        background-image: linear-gradient(
          0deg,
          transparent 0%,
          rgba(128, 86, 32, 0.2) 2%,
          orange 3%,
          rgba(128, 86, 32, 0.2) 3%,
          transparent 100%
        );
        background-repeat: no-repeat;
        animation: scan 7.5s linear 0s infinite;
      }

      @keyframes scan {
        0% {
          background-position: 0 -100vh;
        }
        35%,
        100% {
          background-position: 0 100vh;
        }
      }

      .terminal {
        box-sizing: inherit;
        position: absolute;
        height: 100%;
        width: 100%;
        padding: 4rem;
        text-transform: uppercase;
      }

      @media screen and (max-width: 600px) {
        .terminal{padding: 2rem;}
      }

      .output {
        color: rgba(255, 192, 128, 0.8);
        text-shadow: 0 0 1px orange,
          0 0 2px rgba(255, 255, 255, 0.8);
      }

      .output::before {
        content: "> ";
      }

      a {
        color: #fff;
        text-decoration: none;
      }

      a::before {
        content: "[";
      }

      a::after {
        content: "]";
      }

      .errorcode {
        color: white;
      }
      img{
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%) scale(2);
        -webkit-transform: translate(-50%, -50%) scale(2);
        opacity: 0.5;
        animation: blink 0.105s infinite;
        pointer-events: none;
      }
      @keyframes blink {
        0%{
            opacity: 0.5;
        }
        25%{
            opacity: 0.25;
        }
        50%{
            opacity: 0.5;
        }
        75%{
            opacity: 0.25;
        }
        100%{
            opacity: 0.5;
        }
      }
    </style>
  </head>
